#include<iostream>
#include<vector>
using namespace std;

vector<int> mostCompetitive(vector<int>& nums, int k) {
    vector<int> ans(k);
    
    int left = 0, right = nums.size() - k + 1;
    
    int index = 0;
    while (left < right) {
        int min = nums[left];
        for (int i = left; i < right; i++) {
            if (nums[i] < min) {
                min = nums[i];
                left = i;
            }
        }
        if (right < nums.size())
            right++;
        ans[index++] = nums[left++];
        if (index == k)
            break;
    }
    
    return ans;
}

